import { BrowserRouter, Routes, Route } from "react-router";
import { AutorizationPage } from './pages/AutorizationPage'
import { RegistrationPage } from './pages/RegistrationPage'
import { DevTypesPage } from './pages/DevTypesPage'
import { RequestPage } from './pages/RequestPage'
export function App() {
    return (
        <Routes>
            <AutorizationPage path='/autorize' />
            <RegistrationPage path='rergistration' />
            <DevTypesPage path='request/devTypes' />
            <RequestPage path='request' />

        </Routes>
    );
}
